P.L-1:
MJ 24-03-2020:&#13;
This task is part of the vBRS (Vector Basic Runtime System) start-up. It is a basic task which terminates after calling EcuM_StartupTwo() and Os_InitialEnableInterruptSources().&#13;
Let's keep its priority high since we only use it during start-up and it should not be blocked by other tasks.

March 25th, 2019. Mark Janssen&#13;
The ApplTimedInitDeInit task shall have a priority lower than the ApplMainFunctions task. If a task contains runnables with mode disabling dependencies, such as the ApplMainFunctions task, its priotiry shall be higher than tasks containing runnables with mode change triggers.&#13;
The combination of mode disabling dependencies and mode trigger allows the ApplTimedInitDeInit task to have a priority less than ApplMainFunctions.
